import React from 'react';
import './Energy.css';
import EnergyGraph from './EnergyGraph'

function Energy() {

    return (
        <div className = "container-energy" >
            <div className = "energy-menu" class = "flex bg-gray-50 shadow-md rounded-3xl h-5/6 w-5/6 m-auto">
                <div className = "energy-level-heading" class = "flex bg-green-400 h-8 w-64 rounded-3xl mt-2.5 ml-8 justify-center fixed">
                    <p class = "text-white mt-1.5 font-semibold text-sm">YOUR ENERGY LEVELS</p> 
                </div>
                <div className = "crysta-explanation-text" class = "flex leading-3 text-sm mt-2.5 ml-96 text-left w-2/4 float-right fixed">
                    <p class = "">Distractions are a sign of low energy. Crysta analyzes the number of task switches you make per hour, 
                        and based on this, it calculates your most and least productive times throughout the day. Lower = more productive (better for focus), 
                        Higher = less productive (more creative).</p>
                </div>
                <div className = "energy-graph-container" class = "flex-1 flex-col ml-8 mt-12 mr-8 w-5/6 h-5/6">
                    <EnergyGraph />
                </div>
            </div>
        </div>
    );
}

export default Energy;
